import * as React from 'react';
import { StyleSheet, Text, View, Button, ActivityIndicator } from 'react-native';
import { StatusBar } from 'expo-status-bar';




const styles = StyleSheet.create({
    h3: {
      fontWeight: "bolder"
    },
    info: {
      display: "flex",
      justifyContent: "space-between",

      alignItems: "center",
      paddingLeft: "5px",
      paddingRight: "50px",

    },
    container: {
      flex: '1',
      backgroundColor: '#fff',
      color: "#FFFFFF",
      alignItems: 'center',
      justifyContent: 'center',
    },
    station: {
      display: "flex",

      backgroundColor: '#BCE3FF',
      margin: '10px',
      marginBottom: '5px',
      padding: '20px',
      borderRadius: "20px"
    },
    button: {
      textDecorationLine: "none",
      padding: "20px",
      borderRadius: "5px",
      backgroundColor: "#789EFF",
      color: "#ffffff",
      fontWeight: "900"
    }

  });
